import React from "react";
import User from "./User";

class Users extends React.Component {
    render() {
        return (
            <div>
                {this.props.users.length > 0 ? (
                    this.props.users.map((el) => <User key={el.id} user={el} />)
                ) : (
                    <div>Нифига нет</div>
                )}
            </div>
        );
    }
}

export default Users;
